In one embodiment, the method comprises administering an antibody or antigen binding fragment thereof (e.g., an antibody described in Table 1, such as NOV1401), which specifically binds to human FXI and/or FXIa, and exhibits one or more (e.g., two, or three, or four, or five, or six, or seven), or all, of the following characteristics:
(i) specifically binds to a catalytic domain (CD) of human FXI and FXIa, for example, with an apparent KD of approximately 1-2 pM and 4-5 pM respectively;
(ii) prolongs clotting time as evaluated by activated partial thromboplastin time (aPTT) assay;
(iii) inhibits thrombin generation in human plasma through inhibition of FXI activation by activated factor XII (FXIIa) and by thrombin, respectively;
(iv) shows antithrombotic and anticoagulant activity in FXI−/− mice reconstituted with human FXI;
(v) reduces or prolongs the reduction of free FXI (FXIf) levels, for example, in cynomolgus monkeys;
(vi) has a terminal elimination half-life of total antibody of approximately 14-15 days, for example, in cynomolgus monkeys;
(vii) specifically binds to human and monkey FXI and/or FXIa but does not specifically bind to mouse or rat FXI and/or FXIa; and
(viii) contacts one or more (e.g., two, three, four, five, six, or seven, or more), or some, or all, of the following residues of human FXI (Swissprot numbering): Pro410, Arg413, Leu415, Cys416, His431, Cys432, Tyr434, Gly435, Glu437, Tyr472-Glu476, Tyr521-Lys527, Arg548, His552, Ser575, Ser594-Glu597, and Arg602-Arg604.

A “thromboembolic,” or similar terms as used herein, can also refer to any number of the following, which the anti-FXI and/or FXIa antibodies or antigen binding fragments thereof of the present disclosure can be used to prevent or treat:
thromboembolism in subjects with suspected or confirmed cardiac arrhythmia such as paroxysmal, persistent or permanent atrial fibrillation or atrial flutter;
stroke prevention in atrial fibrillation (SPAF), a subpopulation of which is AF patients undergoing percutaneous coronary interventions (PCI);
acute venous thromboembolic events (VTE) treatment and extended secondary VTE prevention in patients at high risk for bleeding;
cerebral and cardiovascular events in secondary prevention after transient ischemic attack (TIA) or non-disabling stroke and prevention of thromboembolic events in heart failure with sinus rhythm;
clot formation in left atrium and thromboembolism in subjects undergoing cardioversion for cardiac arrhythmia;
thrombosis before, during and after ablation procedure for cardiac arrhythmia;
venous thrombosis, this includes but not exclusively, treatment and secondary prevention of deep or superficial veins thrombosis in the lower members or upper member, thrombosis in the abdominal and thoracic veins, sinus thrombosis and thrombosis of jugular veins;
thrombosis on any artificial surface in the veins or arteries like catheter, pacemaker wires, synthetic arterial grafts; mechanical or biological heart valves or left ventricular assist device;
pulmonary embolism in patients with or without venous thrombosis;
Chronic Thromboembolic Pulmonary Hypertension (CTEPH);
arterial thrombosis on ruptured atherosclerotic plaque, thrombosis on intra-arterial prosthesis or catheter and thrombosis in apparently normal arteries, this includes but not limited to acute coronary syndromes, ST elevation myocardial infarction, non ST elevation myocardial infarction, unstable angina, stent thrombosis, thrombosis of any artificial surface in the arterial system and thrombosis of pulmonary arteries in subjects with or without pulmonary hypertension;
thrombosis and thromboembolism in patients undergoing percutaneous coronary interventions (PCI);
cardioembolic and cryptogenic strokes;
thrombosis in patients with invasive and non-invasive cancer malignancies;
thrombosis over an indwelling catheter;
thrombosis and thromboembolism in severely ill patients;
cardiac thrombosis and thromboembolism, this includes but not exclusively cardiac thrombosis after myocardial infarction, cardiac thrombosis related to condition such as cardiac aneurysm, myocardial fibrosis, cardiac enlargement and insufficiency, myocarditis and artificial surface in the heart;
thromboembolism in patients with valvular heart disease with or without atrial fibrillation;
thromboembolism over valvular mechanic or biologic prostheses;
thromboembolism in patients who had native or artificial cardiac patches, arterial or venous conduit tubes after heart repair of simple or complex cardiac malformations;
venous thrombosis and thromboembolism after knee replacement surgery, hip replacement surgery, and orthopedic surgery, thoracic or abdominal surgery;
arterial or venous thrombosis after neurosurgery including intracranial and spinal cord interventions;
congenital or acquired thrombophilia including but not exclusively factor V Leiden, prothrombin mutation, antithrombin III, protein C and protein S deficiencies, factor XIII mutation, familial dysfibrinogenemia, congenital deficiency of plasminogen, increased levels of factor XI, sickle cell disease, antiphospholipid syndrome, autoimmune disease, chronic bowel disease, nephrotic syndrome, hemolytic uremia, myeloproliferative disease, disseminated intra vascular coagulation, paroxysmal nocturnal hemoglobinuria and heparin induced thrombopenia;
thrombosis and thromboembolism in chronic kidney disease; and
thrombosis and thromboembolism in patients undergoing hemodialysis and in patients undergoing extra-corporal membrane oxygenation.

In particular embodiments, subjects in need of treatment with an anti-FXI/FXIa antibody described herein, for example, an anti-FXI/FXIa antibody described in Table 1, such as, NOV1401 (e.g., antibody comprising a heavy chain comprising the amino acid sequence of SEQ ID NO: 31 and a light chain comprising the amino acid sequence of SEQ ID NO: 41) or anti-FXI/FXIa antibodies comprising VL CDRs and VHCDRs of NOV1401, may include:
Subjects with indications for chronic anticoagulation therapy (e.g., AF, left ventricular thrombus, prior cardioembolic stroke);
subjects at intermediate-to-high risk for major bleeding;
subjects undergoing elective or primary percutaneous coronary intervention (PCI) with stenting which may be require to receive single or dual antiplatelet therapy (e.g., aspirin and/or P2Y12 receptor antagonists) to prevent stent thrombosis.

