(a) 65 years old or older;
(b) history of previous stroke or transient ischemic attack;
(c) previous major bleed or clinically relevant bleed;
(d) chronic kidney disease (CKD) stage 3 to 4;
(e) treatment with single or dual antiplatelet therapy; and
(f) history of falls associated with hematoma bruise or other manifestations.

Secondary Objectives:
1: To evaluate the proportion of patients achieving FXI inhibition ≥80% at trough after the first and second dose (Day 31 and Day 61) at 3 dose levels of NOV1401;
2: To evaluate the incidence of major bleeding events, clinically relevant non-major bleeding events and total bleeding with NOV1401 relative to an NOAC during the treatment period;
3: To assess the effect of NOV1401 on D-dimer and other thrombogenesis biomarkers as indicators of efficacy at Day 31, Day 61 and Day 91 compared to a NOAC; and
4: To evaluate the safety and tolerability of NOV1401 compared to a NOAC.

Study design: This is a randomized, open-label, blinded endpoint evaluation, active-controlled, dose-range finding study. After a screening period of 1 to 2 weeks, patients will be randomized to 1 of 4 treatment groups below (low, medium or high dose NOV1401 or a NOAC) in a 1:1:1:1 ratio and followed during a 90-day treatment period:
1. NOV1401 120 mg subcutaneous administration once a month;
2. NOV1401 150 mg subcutaneous administration once a month;
3. NOV1401 180 mg subcutaneous administration once a month; and
4. a NOAC.

Key Inclusion Criteria:
Male and female patients ≥55 and <85 years old;
Body weight between 50 and 130 kg inclusive;
Atrial fibrillation or atrial flutter, as documented by electrocardiography;
CHA2DS2-VASc risk score ≥2 for male and female patients, male patients with CHA2DS2VASc risk score of 1 can be included if anticoagulation therapy is warranted; and
Either anticoagulant-naïve or receiving a stable treatment of a recommended dose of a new oral anticoagulant (NOAC) over the 8 weeks prior to screening.

Key safety assessments:
Confirmed major bleeding events, clinically relevant non-major bleeding events and total bleeding events;
Adverse event monitoring;
Occurrence of major cardiovascular and cerebral events (stroke, transient ischemic attack, systemic embolism, myocardial infarction, venous thromboembolism and cardiovascular death;
Physical examinations;
Monitoring of laboratory parameters in blood;
ECGs;
Hypersensitivity reactions;
Injection site reactions; and
Development of anti-drug antibodies;
